import * as React from 'react';
import {
  DataGrid
} from '@mui/x-data-grid';


// function CustomToolbar() {
//   return (
//     <GridToolbarContainer>
//       <GridToolbarColumnsButton />
//       <GridToolbarFilterButton />
//       <GridToolbarDensitySelector />
//       <GridToolbarExport />
//     </GridToolbarContainer>
//   );
// }
const columns = [
    {
      field: 'ticker',
      headerName: 'Ticker',
      width: 150,
      editable: true,
    },
    {
        field: 'ceiling',
        headerName: 'Ceiling',
        type: 'number',
        width: 110,
        editable: true,
      },
    {
      field: 'floor',
      headerName: 'Floor',
      type: 'number',
      width: 110,
      editable: true,
    },
    {
      field: 'highest',
      headerName: 'Hi',
      type: 'number',
      width: 110,
      editable: true,
    },
    {
      field: 'lowest',
      headerName: 'LOWEST',
      type: 'number',
      width: 110,
      editable: true,
    },
    {
      field: 'match',
      headerName: 'MATCH',
      type: 'number',
      width: 110,
      editable: true,
    },
    {
      field: 'volume',
      headerName: 'VOLUME',
      type: 'number',
      width: 110,
      editable: true,
    },
  ];
  const rows = [
    { ticker: 'ACB', ceiling: 305, floor: 3.7, highest: 67, lowest: 4.3, match: 0.4, volume: 1000 },
    { ticker: 'ACB', ceiling: 305, floor: 3.7, highest: 67, lowest: 4.3, match: 0.4, volume: 1000 },
    { ticker: 'ACB', ceiling: 305, floor: 3.7, highest: 67, lowest: 4.3, atch: 0.4, volume: 1000 },
    { ticker: 'APH', ceiling: 452, floor: 25.0, highest: 51, lowest: 4.9, match: 42.2, volume: 1000 },
    { ticker: 'ASM', ceiling: 262, floor: 16.0, highest: 24, lowest: 6.0, match: 4.8, volume: 1000 },
    { ticker: 'ASM', ceiling: 262, floor: 16.0, highest: 24, lowest: 6.0, match: 4.8, volume: 1000 },
    { ticker: 'ASM', ceiling: 262, floor: 16.0, highest: 24, lowest: 6.0, match: 4.8, volume: 1000 },
    { ticker: 'ASM', ceiling: 262, floor: 16.0, highest: 24, lowest: 6.0, match: 4.8, volume: 1000 },
    { ticker: 'ASM', ceiling: 262, floor: 16.0, highest: 24, lowest: 6.0, match: 4.8, volume: 1000 },
    { ticker: 'ASM', ceiling: 262, floor: 16.0, highest: 24, lowest: 6.0, match: 4.8, volume: 1000 },
    { ticker: 'ASM', ceiling: 262, floor: 16.0, highest: 24, lowest: 6.0, match: 4.8, volume: 1000 },
    { ticker: 'ASM', ceiling: 262, floor: 16.0, highest: 24, lowest: 6.0, match: 4.8, volume: 1000 },
    { ticker: 'ASM', ceiling: 262, floor: 16.0, highest: 24, lowest: 6.0, match: 4.8, volume: 1000 },

    // ('BCM', 159, 6.0, 24, 4.0,9.3,1000),
    // ('BHN', 356, 16.0, 49, 3.9,1.4,1000),
    // ('BID', 408, 3.2, 87, 6.5,1.4,1000),
    // ('BMP', 237, 9.0, 37,1.4, 4.3,1000),
    // ('BVH', 375, 0.0, 94, 0.0,1.4,1000),
    // ('CII', 518, 26.0, 65, 7.0,4.8,1000),
    // ('DCM', 392, 0.2, 98, 0.0,4.8,1000),
    // ('DGC', 318, 0, 81, 2.0,4.8,1000),
    // ('DGW', 360, 19.0, 9,4.8, 37.0,1000),
    // ('DHC', 437, 18.0, 63, 4.0,4.8,1000),
    // ('FLC', 437, 18.0, 63, 4.0,4.8,1000),
    // ('FPT', 437, 18.0, 63, 4.0,4.8,1000),
    // {ticker:'X20', 437, 18.0, 63, 4.0,4.8,1000},
  ]; 
    

  export default function DataGridDemo() {
    return (
        <div style={{ height: 400, width: '100%', backgroundColor:'white' }}>
        <DataGrid
            rows={rows}
            columns={columns}
            pageSize={5}
            rowsPerPageOptions={[5]}
            checkboxSelection
            disableSelectionOnClick
            // components={{
            // Toolbar: CustomToolbar,
            // }}
        />
        </div>
    );
}
